## Demonic Banquet

[https://www.deviantart.com/sheikkinen/art/Demonic-Banquet-1000499387](https://www.deviantart.com/sheikkinen/art/Demonic-Banquet-1000499387)



### Description

The artwork titled \"Demonic Banquet\" portrays a sinister feast set
within the gothic grandeur of a church-like edifice. At the head of the
banquet table, a demon girl leans forward, her gaze predatory as she
surveys the spread of raw meat before her. The eerie lighting casts
elongated shadows, highlighting the grotesque opulence of the scene.
Stained glass windows throw fractured light across the scene,
contrasting the sanctity of the setting with the malevolence of the
gathering.

\

