**Name:** Valyra Stormborn

**Title:** Guardian of the Tempest Isles

**Background:** Valyra was born during the fiercest storm ever recorded
on the Tempest Isles, a chain of rugged, storm-swept islands far out in
the Obsidian Sea. Legend has it that the lightning which lashed the sky
as she came into the world struck her cradle, imbuing her with the
elemental power of the storm. Raised by the tempest priests of the
island, Valyra was trained from a young age in the ancient arts of storm
manipulation and combat.

