presence commands attention. Her hair, as pale as moonlight, flows
wildly around her face, often seeming to dance with static energy. Her
eyes, a piercing blue, reflect the relentless power of the sea. Valyra
wears armor crafted from the silver-white scales of the sea drakes that
roam the deep waters around her home---lightweight yet impenetrably
strong. The armor is accented with stormsilver, a rare metal that
channels the power of lightning.

**Abilities:** As a Guardian of the Tempest Isles, Valyra possesses the
ability to manipulate weather patterns. She can summon gusts of wind to
hasten her movements or deflect attacks, call down bolts of lightning to
strike her foes, and invoke rain to heal her wounds. Her mastery of the
storm makes her a formidable foe in combat.

**Weapons:** Valyra wields the Stormglaive, a legendary weapon forged
from the heart of a meteorite that fell to the isles during a night of
shooting stars. The glaive crackles with electric energy and is said to
be as unpredictable as the weather itself.

**Personality:** Valyra is fierce and steadfast, tempered by a life
spent mastering the volatile nature of the storm. She is a natural
leader, respected and followed by the islanders for her strength and
wisdom. Despite her formidable abilities, Valyra is deeply
compassionate, always using her powers to protect her people and the
fragile beauty of her storm-wracked homeland.

**Current Quest:** Now, a new threat looms over the Tempest Isles---a
dark sorcerer seeks to harness the islands\' elemental energies for his
own nefarious purposes. Valyra must venture beyond her homeland to
gather allies and confront this new enemy, all while struggling to
control the growing storm within her---a storm that threatens to consume
her if she steps too far from the path of her destiny.


