### Description

#### Encounter: The Cursed Priestess of Qalir

In the dimly lit corner of the Harbor Tavern, amongst the murmurs of
sailors and the clinking of tankards, sits a figure that commands the
wary attention of all: the Cursed Priestess of Qalir. Her appearance is
striking, not only for the serpentine majesty of the mask that covers
her face---reminiscent of a legendary creature from the deep---but also
for the crimson hue of her scaled hands and the ominous curl of horns
that arch back from her head, whispering of her cursed nature.

Legend speaks of the Priestess once being a devout servant to the
goddess Hylia, her fervor unmatched throughout the land of Eternia.
However, during a forbidden ritual intended to summon the benevolent
gaze of Hylia, something darker answered her call. An entity from beyond
the realms, known only as The Red Seraph, bestowed upon her the twisted
gift of prophecy, at the cost of her human visage and a thirst for the
life essence of men.

Now, she offers her foresight to those daring enough to meet her gaze
and pay her price---a vial of blood from a creature of the wilds. You
and your companions have sought her out, for it is said her prophecies
speak of paths to hidden treasures, forgotten magics, and the dark fates
of those who dare the deeper waters.

As you approach, her voice, though muffled behind the mask, carries a
melodic yet chilling tone. \"Seekers of truth, bearers of the courageous
heart, come forth. What shadows cast by future\'s light seek you in the
murky depths of fate?\"

Her eyes, visible only as glowing embers within the recesses of her
mask, fixate on each of you, awaiting your questions or the signal to
commence the ritual of prophecy. The air around her thickens, the
candles flicker as if in dread, and the tavern\'s usual din seems to
hush in anticipation of the secrets she might unveil.


